import Header from '../Header/Header';
import ProfileImage from '../../images/profile.png';
import './Home.css';

function Home() {
    return (
      <div className='home'>
        <Header />
        <div className='home__body'>
          <img src={ProfileImage} alt="" />
        </div>
      </div>
    );
}

export default Home;
